the owner."},"setAffiliation(uint256)":{"params":{"_reward":"percentage of reward in bips(3)"}},"setClaimTime(uint256)":{"params":{"_time":"."}},"setTime(uint256,uint256)":{"params":{"_endTime":".","_startTime":"."}},"transferOwnership(address)":{"details":"Transfers ownership of the contract to a new account (`newOwner`). Can only be called by the current owner."}},"version":1},"userdoc":{"kind":"user","methods":{"__GempadLaunchpad_init(uint256,(address,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256),(address,uint256,uint256,address,uint256,bool),(bool,uint256,uint256,uint256),address,bool,bool,uint256,bool,address,address)":{"notice":"initialize the core params of laucnhpad."},"addWhitelist(address[])":{"notice":"add users to whitelist"},"buyToken(uint256,address)":{"notice":"user buy Tokens"},"cancel()":{"notice":"cancel the sale"},"claimReward()":{"notice":"called referrer to claim their share of reward from total"},"claimTokens()":{"notice":"called by the investor the claim the tokens against investment as per vesting terms"},"claimUserRefund()":{"notice":"called by investor to get refund incase of sale cancellation or failure to reach soft cap"},"enablePublicSale(uint256)":{"notice":"enable public or private sale time."},"finalize()":{"notice":"finalize the sale and withdraw sell funds and sell token balance"},"getUserRemainingClaimable(address)":{"notice":"the remaing amount out of total amuont of tokens."},"getUserTokens(address)":{"notice":"return the total amount of tokens user will receive against investment."},"removeWhitelist(address[])":{"notice":"remove usres from whitelist"},"setAffiliation(uint256)":{"notice":"set afflication terms"},"setClaimTime(uint256)":{"notice":"set specific time to claim tokens"},"setTime(uint256,uint256)":{"notice":"update start and end time before sale start"},"withdrawTokens()":{"notice":"called by owner to get refund incase of sale cancellation or failure to reach soft cap"}},"version":1}}